import Header from '../components/header'
import axios from 'axios'


export default function Blogs() {
    return (
        <div>
            <Header />
            <h1>博客页面</h1>
        </div>
    )
}

export async function getStaticProps(context) {
    axios.get('/blogs/list')
    .then(function(response){
        console.log(response)
    })
    .catch(function(err){
        console.err(err)
    })
}
